  \"2016-10-26T17:56:41.334329\",\n\t\"name\": \"medicare-hospital-spending-per-patient-medicare-spending-per-beneficiary-additional-decima-55239\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The \"Medicare hospital spending per
  patient (Medicare Spending per Beneficiary)\" measure shows whether Medicare spends
  more, less or about the same per Medicare patient treated in a specific hospital,
  compared to how much Medicare spends per patient nationally. This measure includes
  any Medicare Part A and Part B payments made for services provided to a patient
  during the 3 days prior to the hospital stay, during the stay, and during the 30
  days after discharge from the hospital. The data displayed here are identical to
  the data displayed in the u00e2u0080u009cMedicare hospital spending per patient
  (Medicare Spending per Beneficiary)u00e2u0080u009d file, except that this file displays
  hospitalsu00e2u0080u0099 measure values out to six decimal places instead of two
  decimal places.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
